function Vids(props) {

  var url = new Array([]);
  var title = new Array([]);
  var i = 0;
  const api = "AIzaSyB5_Kc5h-Z72FAt4LWm7veU-UWoS8LfUPc";
  fetch("https://youtube.googleapis.com/youtube/v3/videos?part=snippet&chart=mostPopular&key=AIzaSyB5_Kc5h-Z72FAt4LWm7veU-UWoS8LfUPc&maxResults=9", {
      headers: {
          Authorization : api,
          Accept: "application/json"
      }
  }).then((response)=>{
      return response.json()
  }).then((val)=>{
      console.log(val.items);
      for (let index = 0; index < 9; index++) {
          title.push(val.items[index].snippet.title);
          if (val.items[index].snippet.thumbnails.maxres === undefined) {
              url.push("url('" + val.items[index].snippet.thumbnails.standard.url + "')");
          }

          else
          {
              url.push("url('" + val.items[index].snippet.thumbnails.maxres.url + "')");
          }

          console.log(url[i++]);
      }
  });

  i = 0;



  return (
    <>
      <div className="vids">
        <div className="thumbnail">
        </div>
        <div className="chnl_text">
          <div className="chnl_pic">
          </div>
          <div className="vid_desc">
            <div className="main_desc">{props.title}</div>
            <div className="chnl_name">Arnav Gaur</div>
            <div className="vid_stats">
              <div className="vid_views">300k views</div>
              <div className="partition">
                <div className="partition_inside"></div>
              </div>
              <div className="vid_date">3 months ago</div>
            </div>
          </div>
        </div>
      </div>
    </>
  )
}

const arr = [1, 2, 3 ,4, 5, 6, 7, 8, 9];

const Home = () => {
    
    return(
      <>
      <div className="scroll_top">
        <div className="All">
          All
        </div>
      </div>

      <div className="vid_holder">

        {/* <div className="vids">

        </div> */}
        {arr.map(() => <Vids title = {title[i++]}/>)}

        
      </div>
      </>
    )

  };
  
  export default Home;
